parentCtrlV2:"家長控制功能可以有效規範孩子的上網時間，設置允許孩子聯網的固定時間，適度合理地使用網路。",parentCtrlV2Tip1:"如果“允許上網時間”中提示“未與網路時間同步”，則家長控制功能不生效，同時請檢查您的網路連接是否正常。",parentCtrlV2Tip:"注：最多可以設置10條規則且同一設備僅允許設置一條規則。",parentCtrlV2Tip2:"",remoteMng:"遠程管理功能可以讓您通過WAN口IP地址對路由器進行配置管理。",remoteMngTip:"允許的IP地址為255.255.255.255時，表示任何IP的終端都可遠程控制路由器。",safeMng:"開啟防火牆後，可針對DoS攻擊進行具體防範，抵禦更多存在於互聯網上的攻擊風險。",dosAttack:"",dosAttackTip:"",dosAttackTip1:"",dosAttackTip2:"",dosAttackTip3:"",forbidPing:"",forbidPingTip:"",forbidPingTip1:"",forbidPingTip2:"",forbidPingTip3:"",
arpFloodAttack:"",arpFloodAttackTip:"",arpCheating:"",arpCheatingTip:"",broadcastArp:"",broadcastArpTip:"",arpBindList:"",arpBindListTip:"",screenSet:"自定義螢幕亮顯和關閉的時間，以免為您造成不必要的困擾。",screenSetTip:"",passwordShow:"",passwordShowTip:"",citySelect:"",citySelectTip:"",signal:"本功能可智能調節路由器的無線信號強度，健康綠色。",autoUpgrade:"線上升級功能可以實現路由器版本的快速檢測與升級，讓您及時獲取新版本、體驗新功能。",autoUpgradeTip1:"通過設置自定義升級時間，可以實現路由器版本的自動檢測、自動升級。 ",autoUpgradeTip2:"如果系統狀態中提示“未與網路時間同步”，則該自動升級功能不生效，同時請檢查您的網路連接是否正常。",autoUpgradeTip:"溫馨提示：軟體升級過程中路由器將自動重啟，期間請勿切斷電源。",
usbStorage:"管理存儲設備（與路由器相連）中的檔資源。可進行設備安全移出、存儲共用、存儲加密、媒體伺服器等功能操作。在斷開路由器與存儲設備的連接時，請點擊 <b>安全移除</b> ，以避免對存儲數據或產品造成損壞。",usbRemoveNote:"請注意，如果開啟 <b>存儲加密</b>， 而該存儲設備曾經在未加密的情況下連接使用過，請先運行命令： <i>net use * /delete</i>，以清除本機緩存的登錄資訊。",usbTip:"注：為方便使用，存儲加密功能不會對媒體伺服器加密，如共用檔涉及個人隱私，可選擇關閉媒體伺服器並通過Samba訪問加密檔",usbTip1:"",usbTip2:"",networkTip:"注：網路名稱支持的特殊字元包含（空格）!\"#$%&'()*+,-./:;<=?@[\\]^_`{|}~",wisp:"利用無線擴展功能，主、從路由器之間可以通過無線進行橋接，擴展無線網路的覆蓋範圍。實現擴展可以通過掃描選擇（建議）或手動輸入兩種方式。",wispTip:"網路名稱支持中文、數字、字母、特殊符號組合。",upnp:"通用即插即用（UPnP）功能允許網路中的設備根據需要訪問本地資源或設備，實現設備間的自動連接和協同工作。",
upnpTip:"UPnP設備可以由局域網上的UPnP服務應用程式自動識別發現。",portServerIp:"伺服器IP",portAgreeMent:"協議",portExternal:"外部端口",portInternal:"內部端口",portFwdHelp:"通過端口轉發可以開放指定的端口，在保證內網完全的前提下實現互聯網對指定端口的內網伺服器的訪問。",portFwdIp:"局域網中作為伺服器的電腦IP地址。",portFwdexter:"路由器為廣域網提供的服務端口。可以為單個端口號，也可以為端口範圍，如：5001-6001。",portFwdinter:"路由器為局域網提供的服務端口。不填表示內部端口與外部端口相同；另外，當外部端口為端口範圍時，內部端口需與它一一對應。",portFwdAgerr:"伺服器所使用的協議。",adminPwd:"管理員密碼",adminPwdTip:"管理員密碼是路由器的安全屏障，可有效防止路由器配置被陌生人篡改。該密碼為5至63個字元，最好是數字、字母、符號組合，且管理員密碼不能為空。",qos:"QoS可以智能設定互聯網帶寬使用優先順序，從而優化您的線上遊戲、流媒體觀看、BT下載、網頁觀看等相關服務體驗。",
regionTimeZone:"",timeZone:"選擇本地時區設置。",vpnClient:"為VPN客戶設置登錄VPN伺服器的規則，包括規則名稱、協議類型、VPN伺服器IP地址（或功能變數名稱），以及登錄的用戶名及密碼。",vpnServer:"選擇VPN伺服器的協議類型，為VPN客戶端登錄設置帳號和密碼。VPN客戶端連接後將與路由器LAN側的設備具有相同的許可權。",wds:"利用WDS功能，主、子路由器可以橋接擴展無線網路的覆蓋範圍。可以通過自動掃描（推薦）或手動連接的方式來擴展指定的WIFI網路。",qosHelp:"服務品質（QoS）是帶寬分配的一種先進技術，您可以使QoS優先於特定流量以超過其他流量。",light:"實現指示燈的開啟或關閉。",lightTip:"注：關閉狀態下重啟路由器，指示燈會恢復開啟狀態5分鐘。",printer:"開啟該功能，將印表機與路由器通過USB連接，並在終端客戶端設置參數，便可以將您的印表機變為網路印表機，為局域網內的每一位用戶提供列印服務。",printerTip:"溫馨提示：使用該功能，需要在終端設備上提前安裝好相應客戶端，進行參數配置。",
wifiTimeSwitch:"定時開關",wifiTimeSwitchTip:"實現無線網路的定時關閉和開啟。當設置的時間段剛好包含當前系統時間時，WIFI不會立即關閉，第二天這個時間段設置才會生效。另，如果路由器當前時間未同步網絡時間，則該功能不生效，同時請檢查您的網路連接是否正常。當定時的起始、截至時間相同時，設置不生效。",guestTimeSwitchTip:"實現訪客網路的定時關閉和開啟。當設置的時間段剛好包含當前系統時間時，WIFI不會立即關閉，第二天這個時間段設置才會生效。另，如果路由器當前時間未同步網絡時間，則該功能不生效，同時請檢查您的網路連接是否正常。當定時的起始、截至時間相同時，設置不生效。",specialCharacter:"注：支持的部分特殊字元包含(空格)!\"#$%&'()*+,-./:;<>=?@[\\]^_`{|}~",signalCondition:"該功能通過調節無線路由器的信號強度可以實現節能和減少輻射，您可以根據自己家裏的實際情況和使用需求選擇不同的信號強度。",currentTimeTip:"“當前時間”是指從NTP網路時間伺服器同步的標準時間；如果 “當前時間”提示 “未與網路時間同步”，請檢查網路設置或者重啟路由器。",
timeSleep:"設置路由器在閒置時間進入休眠狀態，可以減少路由器功耗。定時結束時，通過自啟動程式恢復路由器狀態至休眠前狀態。",timeSleepTip1:"路由器休眠期間，可以通過斷電重啟的方法強制退出休眠狀態。",timeSleepTip2:"當定時的起始、截至時間相同時，休眠設置不生效。另，如果路由器當前時間未同步網絡時間，則該功能不生效，同時請檢查您的網路連接是否正常。",timeSleepTip3:"",whiteList:"白名單功能開啟後，只有名單內的設備可以聯網，名單外的陌生用戶都將被攔截至攔截終端列表。",whiteListTip:"白名單開啟後，訪客網路將被禁用，其中定時功能也禁用。關閉白名單功能後，訪客網路原配置重新生效。",whiteListTip2:"",urlBlock:"網址攔截功能可以有效規範設備的上網行為，通過添加網址規則（系統網址添加或自定義添加）過濾掉所禁止的網址，使其無法訪問。",urlBlockTip:"用戶自定義攔截網址請輸入網址關鍵字，如需攔截www.baidu.com，輸入baidu即可。",urlBlockTip1:"注：每條規則最多支持20條自定義網址，最大支持1024B字元數長度。單條關鍵字最大支持64B字元長度。最多支持10條規則。",
